import logo from './logo.svg';
import './Header.css';

function Header() {
  return (
      <header className="App-header">
        <nav class="navbar navbar-light bg-light">
            <img src={logo} class="rounded float-left" alt="logo" />
        </nav>
      </header>
  );
}

export default Header;
